`,paraId:47,tocIndex:8},{value:"With the above example, we basically understand how to model data in a plugin, including.",paraId:48,tocIndex:9},{value:"Defining collections and common fields",paraId:49,tocIndex:9},{value:"Defining association collections and fields relationships",paraId:49,tocIndex:9},{value:"Extending fields of an existing collections",paraId:49,tocIndex:9},{value:"Extending new field types",paraId:49,tocIndex:9},{value:"We have put the code covered in this chapter into a complete sample package ",paraId:50,tocIndex:9},{value:"packages/samples/shop-modeling",paraId:50,tocIndex:9},{value:", which can be run directly locally to see the results.",paraId:50,tocIndex:9}],Go={},kr={title:"BlockProvider",toc:"menu",filename:"docs/en-US/api/client/extensions/block-provider.md",lastUpdated:1699622266e3},Nr=[{id:"blockprovider",depth:1,title:"BlockProvider"},{id:"kernel-methods",depth:2,title:"Kernel Methods"},{id:"blockprovider-",depth:3,title:"<BlockProvider />"},{id:"useblockrequestcontext",depth:3,title:"useBlockRequestContext()"},{id:"build-in-blockprovider-components",depth:2,title:"Build-in BlockProvider Components"},{id:"calendarblockprovider-",depth:3,title:"<CalendarBlockProvider />"},{id:"tablefieldprovider-",depth:3,title:"<TableFieldProvider />"},{id:"tableblockprovider-",depth:3,title:"<TableBlockProvider />"},{id:"tableselectorprovider-",depth:3,title:"<TableSelectorProvider />"},{id:"formblockprovider-",depth:3,title:"<FormBlockProvider />"},{id:"formfieldprovider-",depth:3,title:"<FormFieldProvider />"},{id:"detailsblockprovider-",depth:3,title:"<DetailsBlockProvider />"},{id:"kanbanblockprovider-",depth:3,title:"<KanbanBlockProvider />"}],Ma=[{value:"<BlockProvider />",paraId:0},{value:"useBlockRequestContext()",paraId:0},{value:"<CalendarBlockProvider />",paraId:0},{value:"<TableFieldProvider />",paraId:0},{value:"<TableBlockProvider />",paraId:0},{value:"<TableSelectorProvider />",paraId:0},{value:"<FormBlockProvider />",paraId:0},{value:"<FormFieldProvider />",paraId:0},{value:"<DetailsBlockProvider />",paraId:0},{value:"<KanbanBlockProvider />",paraId:0}],eo={},mo={title:"Core concepts",toc:"menu",filename:"docs/en-US/development/server/collections/index.md",lastUpdated:1699622266e3,description:"Collection is a collection of all kinds of data, such as orders, products, users, comments, etc. Different collections are distinguished by name, e.g."},ur=[{id:"core-concepts",depth:1,title:"Core concepts"},{id:"collection",depth:2,title:"Collection"},{id:"collection-field",depth:2,title:"Collection Field"},{id:"field-type",depth:3,title:"Field Type"},{id:"field-component",depth:3,title:"Field Component"},{id:"field-interface",depth:3,title:"Field Interface"}],Io=[{value:"Collection is a collection of all kinds of data, such as orders, products, users, comments, etc. Different collections are distinguished by name, e.g.",paraId:0,tocIndex:1},{value:`// Orders
